import { CRow, CCol, CSpinner } from "@coreui/react";
import DWidget from "src/Components/UI/DWidget";
const Dashboard = () => {
  const widget = (
    <CCol sm="12" md="3">
      <DWidget
        value={"12"}
        text="Total Users"
        color="gradient-danger"
        icon="cil-people"
      />
    </CCol>
  );
  return (
    <>
      <CRow>
        {widget}
        {widget}
        {widget}
        {widget}
        <CSpinner />
      </CRow>
    </>
  );
};
export default Dashboard;
